import { BlogCard, Images } from './../components';

const data = Array(3).fill({
    imgSrc: Images.blog1,
    header: 'What Our Customer',
    content: '',
    goTo: '',
    imgAlt: 'blog-img'
})

export default ({}) => (
    <div>
        {
            data.map(i => 
                <BlogCard 
                    imgSrc ={i.imgSrc}
                    header={i.header}
                    content={i.content}
                    goTo={i.goTo}
                    imgAlt={i.imgAlt}
                />
            )
        }
    </div>
)
